import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

export default function Index() {
    return (
        <div>
        <Link href="/">
            <a stle={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
        <a title="About Page">About Page</a>
        </Link>
        </div>
    )
}
